import groovy.util.XmlSlurper

def responseContent = testRunner.testCase.getTestStepByName("GetCountries").getPropertyValue("response")
log.info(responseContent)

def xmlResponse = new XmlSlurper().parseText(responseContent)
def slurperResponse = new XmlSlurper().parseText(xmlResponse.Body.GetCountriesResponse.GetCountriesResult.toString())

log.info(slurperResponse)

assert slurperResponse.Table.Name[208] == "Sweden"

def countryAbbrviation = slurperResponse.Table.Name[208]

log.info("CountryName :" + " " +  countryAbbrviation)

testRunner.testCase.testSuite.project.setPropertyValue("CountryNameFromGetCountries", countryAbbrviation.toString())

import groovy.util.XmlSlurper

def responseContent = testRunner.testCase.getTestStepByName("GetCountries").getPropertyValue("response")
log.info(responseContent)

def xmlResponse = new XmlSlurper().parseText(responseContent)
def slurperResponse = new XmlSlurper().parseText(xmlResponse.Body.GetCountriesResponse.GetCountriesResult.toString())

log.info(slurperResponse)

assert slurperResponse.Table.Name[208] == "Sweden"

def countryName = slurperResponse.Table.Name[208]

log.info("CountryName :" + " " +  countryName)

com.eviware.soapui.SoapUI.globalProperties.setPropertyValue("CountryNameFromGetCountries", countryName.toString())
